import React from 'react';
import EmpData from './DashboardPage.json';
import './App.css';
function EmployeeList(props) {

    return (
        <div>
           <h1>Employee List</h1>
           <table></table>
           <tr>
                   <th>Name</th>
                   <th>Age</th>
                   <th>Gender</th>
                   <th>Email</th>
                   <th>phone No</th>
                   <th></th>

               </tr>
           {EmpData.map((empList, index) => {
               return <div className="empList"> 
               <table>
             
               <tr>
               <td>{empList.name}</td>
               <td>{empList.age}</td>
               <td>{empList.gender}</td>
               <td>{empList.email}</td>
               <td>{empList.phoneNo}</td>
               </tr>
               </table>
               </div>
           })}
     
        </div>
    )
}

export default EmployeeList
